const csvText = $input.first().json.data || $input.first().json.body || String($input.first().json);
const lines = csvText.split('\n').filter(line => line.trim());
if (lines.length < 2) throw new Error('CSV is empty');
const headers = lines[0].split(',').map(h => h.replace(/"/g, '').trim());
const rows = [];
for (let i = 1; i < lines.length; i++) {
  const values = [];
  let current = '', inQuotes = false;
  for (const char of lines[i]) {
    if (char === '"') inQuotes = !inQuotes;
    else if (char === ',' && !inQuotes) { values.push(current.trim()); current = ''; }
    else current += char;
  }
  values.push(current.trim());
  const row = {};
  headers.forEach((h, idx) => { row[h] = values[idx] || ''; });
  rows.push({ json: row });
}
return rows;

const items = $input.all();
const positions = {};
for (const item of items) {
  const row = item.json;
  const way = row.Way || '';
  const baseType = row['Base type'] || '';
  if (!way || way === 'Way' || baseType !== 'STOCK') continue;
  if (way !== 'BUY' && way !== 'SELL') continue;
  const baseCurrency = row['Base currency (name)'] || '';
  const tickerMatch = baseCurrency.match(/^([A-Z0-9.]+)\s*\(/);
  if (!tickerMatch) continue;
  const ticker = tickerMatch[1].replace('.MC', '');
  const companyName = baseCurrency.match(/\(([^)]+)\)/)?.[1] || ticker;
  const amount = parseFloat(row['Base amount']) || 0;
  const quoteAmount = parseFloat(row['Quote amount']) || 0;
  if (!positions[ticker]) positions[ticker] = { ticker, company_name: companyName, total_shares: 0, total_cost: 0 };
  if (way === 'BUY') { positions[ticker].total_shares += amount; positions[ticker].total_cost += quoteAmount; }
  else if (way === 'SELL') {
    positions[ticker].total_shares -= amount;
    if (positions[ticker].total_shares > 0) positions[ticker].total_cost *= positions[ticker].total_shares / (positions[ticker].total_shares + amount);
    else positions[ticker].total_cost = 0;
  }
}
const active = Object.values(positions).filter(p => p.total_shares > 0.0001).map(p => ({
  ticker: p.ticker, company_name: p.company_name,
  shares: Math.round(p.total_shares * 1000000) / 1000000,
  total_cost: Math.round(Math.abs(p.total_cost) * 100) / 100,
  avg_cost: Math.round((p.total_cost / p.total_shares) * 100) / 100
}));
// Clear static data at start
const staticData = $getWorkflowStaticData('global');
staticData.results = [];
return active.map(p => ({ json: p }));

const yahoo = $('Yahoo Price').first().json;
const h = $('Loop').first().json;
try {
  const meta = yahoo.chart?.result?.[0]?.meta || {};
  const price = meta.regularMarketPrice || 0;
  const prev = meta.chartPreviousClose || price;
  const value = h.shares * price;
  const pl = value - h.total_cost;
  const plPct = h.total_cost > 0 ? (pl / h.total_cost) * 100 : 0;
  const dailyPL = h.shares * (price - prev);
  return [{ json: { ticker: h.ticker, company_name: h.company_name, shares: h.shares, avg_cost: h.avg_cost, total_cost: h.total_cost, current_price: Math.round(price*100)/100, current_value: Math.round(value*100)/100, unrealized_pl: Math.round(pl*100)/100, unrealized_pl_pct: Math.round(plPct*100)/100, daily_pl: Math.round(dailyPL*100)/100 }}];
} catch(e) { return [{ json: { ...h, current_price: 0, error: e.message }}]; }

const pl = $('Calculate P&L').first().json;
let ai = $('AI Analysis (17 Agents)').first().json;

// Handle array response
if (Array.isArray(ai)) {
  ai = ai[0];
}

const signal = ai.aggregated_signal || 'N/A';

// Calculate combined confidence
let formulaTotal = 0;
let llmTotal = 0;
let llmCount = 0;
let formulaCount = 0;

(ai.agent_results || []).forEach(agent => {
  formulaTotal += agent.confidence || 0;
  formulaCount++;

  const llmResults = agent.analysis_data?.llm_results || {};
  Object.entries(llmResults).forEach(([provider, result]) => {
    if (result.confidence > 0 && !result.reasoning?.includes('Error')) {
      llmTotal += result.confidence;
      llmCount++;
    }
  });
});

const formulaConf = formulaCount > 0 ? Math.round(formulaTotal / formulaCount) : 0;
const llmConf = llmCount > 0 ? Math.round(llmTotal / llmCount) : 0;
const combinedConf = llmCount > 0 ? Math.round((formulaConf + llmConf) / 2) : formulaConf;

let rec = 'HOLD';
if (signal === 'BULLISH' && combinedConf >= 70) rec = 'ACCUMULATE';
else if (signal === 'BULLISH') rec = 'HOLD/BUY';
else if (signal === 'BEARISH' && combinedConf >= 70) rec = 'SELL';
else if (signal === 'BEARISH') rec = 'WATCH';

const staticData = $getWorkflowStaticData('global');
if (!staticData.results) staticData.results = [];
staticData.results.push({ 
  ...pl, 
  ai_signal: signal, 
  ai_confidence: combinedConf,
  formula_confidence: formulaConf,
  llm_confidence: llmConf,
  recommendation: rec 
});

return [{ json: { 
  ...pl, 
  ai_signal: signal, 
  ai_confidence: combinedConf,
  formula_confidence: formulaConf,
  llm_confidence: llmConf,
  recommendation: rec 
} }];

